 export const MainItems=[
{
    name: 'About',
    url:'/about',
    class:'w3-bar-item btn-lg text-white w3-padding-large'

},
{
    name:'Products',
    url:'/products/view',
    class:'w3-bar-item btn-lg text-white w3-padding-large'
}

 ];
 export const SubItems=[
    {
        name: 'Edit Profile',
        url:'/editprofile',
        class:"w3-bar-item w3-button"
    },
    {
        name:'Sign out',
        url:'/signout',
        class:"w3-bar-item w3-button"
    } 

     ];
     export const SignStatus={
      name: 'Sign Out',
      class:'w3-bar-item btn-lg text-white w3-padding-large',
      containerClass:"w3-hide-small"
     }

     export   const routes = [

        {
          path: "/products/add",
          main: () => <AddProducts/>
        },
        {
          path: "/products/delete",
          main: () =><DeleteProducts/>
        },
        {
            path: "/products/view",
            exact: true,
            main: () =><ViewDetails/>
          },
          {
            path: "/products/update",
            main: () =><UpdateProducts/>
          },
        {
          path: "/products/chart",
          main: () =><ChartDisplay/>
        },

      ];
